import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function LoginPage() {
    const navigate = useNavigate();

    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [showError, setShowError] = useState(false);

    const handleSubmit = (e) => {
        e.preventDefault();

        if (username === "admin" && password === "admin") {
            setShowError(false);
            navigate("/chat");
        } else {
            setShowError(true);
        }
    };

    return (
        <>
            {/* Estilos EXACTOS del login original */}
            <style>{`
                :root {
                    --bg-dark: #0d1117;
                    --bg-card: #161b22;
                    --border-card: #30363d;
                    --text-light: #e6edf3;
                    --text-muted: #8b949e;
                    --input-bg: #21262d;
                    --input-border: #30363d;
                    --accent-primary: #6c5ce7;
                    --accent-hover: #7b68ee;
                    --error-bg: rgba(255, 0, 0, 0.2);
                    --error-border: #cc0000;
                    --error-text: #ff6666;
                }

                body {
                    background-color: var(--bg-dark);
                }

                .login-container {
                    width: 100%;
                    max-width: 400px;
                    background-color: var(--bg-card);
                    border: 1px solid var(--border-card);
                    border-radius: 12px;
                    padding: 40px;
                    box-shadow: 0 10px 30px rgba(0, 0, 0, 0.5);
                    text-align: center;
                    margin: 80px auto;
                    color: var(--text-light);
                    font-family: 'Inter', sans-serif;
                }

                .login-logo svg {
                    width: 60px;
                    height: 60px;
                    background-color: var(--accent-primary);
                    padding: 12px;
                    border-radius: 50%;
                    color: white;
                    box-shadow: 0 4px 15px rgba(108, 92, 231, 0.4);
                }

                .login-form {
                    display: flex;
                    flex-direction: column;
                    gap: 20px;
                }

                .form-group label {
                    color: var(--text-muted);
                    font-size: 0.85em;
                }

                .input-wrapper {
                    position: relative;
                }

                .input-wrapper svg {
                    position: absolute;
                    left: 12px;
                    top: 50%;
                    transform: translateY(-50%);
                    width: 18px;
                    height: 18px;
                    color: var(--text-muted);
                }

                .form-group input {
                    width: calc(100% - 24px - 20px);
                    padding: 12px 10px 12px 40px;
                    background-color: var(--input-bg);
                    border: 1px solid var(--input-border);
                    border-radius: 8px;
                    color: var(--text-light);
                    font-size: 1em;
                    outline: none;
                    transition: 0.2s;
                }

                .form-group input:focus {
                    border-color: var(--accent-primary);
                    box-shadow: 0 0 0 2px rgba(108, 92, 231, 0.5);
                }

                .login-button {
                    width: 100%;
                    padding: 13px 20px;
                    background-color: var(--accent-primary);
                    color: var(--text-light);
                    border: none;
                    border-radius: 8px;
                    font-size: 1em;
                    font-weight: 600;
                    cursor: pointer;
                    transition: 0.2s;
                    display: flex;
                    justify-content: center;
                    align-items: center;
                    gap: 8px;
                }

                .login-button:hover {
                    background-color: var(--accent-hover);
                    box-shadow: 0 5px 20px rgba(108, 92, 231, 0.4);
                }

                .error-message {
                    background-color: var(--error-bg);
                    border: 1px solid var(--error-border);
                    color: var(--error-text);
                    padding: 12px;
                    border-radius: 8px;
                    font-size: 0.9em;
                }
            `}</style>

            <div className="login-container">
                <div className="login-logo">
                    <svg xmlns="http://www.w3.org/2000/svg" className="lucide lucide-bot" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                        <path d="M12 8V4H8"/>
                        <path d="M22 7.2L16.4 1.6A3 3 0 0 0 14.8 1H9.2A3 3 0 0 0 7.6 1.6L2 7.2V11H22V7.2Z"/>
                        <path d="M2 11V21H22V11H2Z"/>
                        <path d="M14 21V17H10V21"/>
                        <path d="M8 17H16"/>
                    </svg>
                </div>

                <h1>Bienvenido a Molly</h1>
                <p>Asistente de Ciberseguridad IA. Inicia sesion para continuar.</p>

                <form className="login-form" onSubmit={handleSubmit}>
                    <div className="form-group">
                        <label>Usuario</label>
                        <div className="input-wrapper">
                            <svg xmlns="http://www.w3.org/2000/svg" className="lucide lucide-user" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24">
                                <path d="M19 21v-2a4 4 0 0 0-4-4H9a4 4 0 0 0-4 4v2"/>
                                <circle cx="12" cy="7" r="4"/>
                            </svg>
                            <input
                                type="text"
                                placeholder="admin"
                                value={username}
                                onChange={(e) => setUsername(e.target.value)}
                                required
                            />
                        </div>
                    </div>

                    <div className="form-group">
                        <label>Contrasena</label>
                        <div className="input-wrapper">
                            <svg xmlns="http://www.w3.org/2000/svg" className="lucide lucide-lock" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24">
                                <rect width="18" height="11" x="3" y="11" rx="2" ry="2"/>
                                <path d="M7 11V7a5 5 0 0 1 10 0v4"/>
                            </svg>
                            <input
                                type="password"
                                placeholder="admin"
                                value={password}
                                onChange={(e) => setPassword(e.target.value)}
                                required
                            />
                        </div>
                    </div>

                    {showError && (
                        <div className="error-message">
                            Credenciales invalidas. Usa "admin" / "admin"
                        </div>
                    )}

                    <button className="login-button" type="submit">
                        <svg xmlns="http://www.w3.org/2000/svg" className="lucide lucide-log-in" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24">
                            <path d="M15 3h4a2 2 0 0 1 2 2v14a2 2 0 0 1-2 2h-4"/>
                            <polyline points="10 17 15 12 10 7"/>
                            <line x1="15" y1="12" x2="3" y2="12"/>
                        </svg>
                        Iniciar Sesion
                    </button>
                </form>

                <div className="login-footer">
                    <p>&copy; 2024 Molly AI. Todos los derechos reservados.</p>
                </div>
            </div>
        </>
    );
}

export default LoginPage;
